import React from 'react';
import './App.css';
import Header from './Header';
import Login from './Login';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Register from './Register';
import Contact from './Contact';
import Rule from './Rule';
import Booking from './Beforebooking';
import Home from './Home';

function App() {
  return (

    <div className="App">

      <Router>

        <Header />

        <Switch>
          <Route path="/beforeooking">
            <Beforebooking/>
          </Route>
          <Route path="/rule">
            <Rule/>
          </Route>
          <Route path="/contact">
            <Contact/>
          </Route>
          <Route path="/register"> 
            <Register/>
          </Route>
          <Route path="/login">
            <div className="App__login">
              <Login />
            </div>
          </Route>
          <Route path="/">

            <Home />
          </Route>

        </Switch>
      </Router>
    </div>
  );
}

export default App;
